                <div className="post_description">
                Loved this walpaper
                </div>
                {/*  Image */}
                <div>
                    <img src={post}/>

                </div>
            
                {/*  Like Count */}
                <div>

                </div>

                {/*  Like share box */}
                <div>

                </div>

